// Get position data from query
let rawX = data.series[0]?.fields.find(f => f.name === 'y')?.values || [];  // ROS Y -> Panel X
let y = data.series[0]?.fields.find(f => f.name === 'x')?.values || [];     // ROS X -> Panel Y

// Mirror X values (negate) to fix horizontal flip
let x = rawX.map(val => -val);

// Base64 encoded map image
const mapImage = 'data:image/webp;base64,';

let traces = [];

// Path trace (all points)
if (x.length > 0) {
  traces.push({
    x: x,
    y: y,
    mode: 'lines+markers',
    type: 'scatter',
    name: 'Roboterpfad',
    marker: {
      color: '#3498db',
      size: 4
    },
    line: {
      color: '#3498db',
      width: 2
    }
  });

  // Current position (last point)
  traces.push({
    x: [x[0]],
    y: [y[0]],
    mode: 'markers',
    type: 'scatter',
    name: 'Aktuelle Position',
    marker: {
      color: '#00FF00',
      size: 16,
      symbol: 'circle',
      line: {
        color: '#ffffff',
        width: 2
      }
    }
  });

  // Start point (first point in selected time range)
  traces.push({
    x: [x[x.length - 1]],
    y: [y[y.length - 1]],
    mode: 'markers',
    type: 'scatter',
    name: 'Startpunkt',
    marker: {
      color: '#FF5733',
      size: 12,
      symbol: 'square'
    }
  });
}

return {
  data: traces,
  layout: {
    autosize: true,
    images: [
      {
        layer: 'below',
        opacity: 0.8,
        sizex: 83.7,
        sizey: 64.6,
        sizing: 'stretch',
        source: mapImage,
        x: -31.5,
        xref: 'x',
        y: 40.5,
        yref: 'y'
      }
    ],
    legend: {
      bgcolor: 'rgba(0,0,0,0.5)',
      font: {
        color: '#ffffff'
      },
      x: 0,
      y: 1
    },
    margin: {
      b: 50,
      l: 50,
      r: 20,
      t: 30
    },
    paper_bgcolor: 'rgba(0,0,0,0)',
    plot_bgcolor: 'rgba(0,0,0,0)',
    showlegend: true,
    xaxis: {
      gridcolor: 'rgba(255,255,255,0.2)',
      range: [-12, 12],
      showgrid: true,
      tickfont: {
        color: '#aaaaaa'
      },
      title: {
        font: {
          color: '#ffffff'
        },
        text: 'Y (Meter) - Links/Rechts'
      },
      zeroline: true,
      zerolinecolor: 'rgba(255,255,255,0.4)'
    },
    yaxis: {
      gridcolor: 'rgba(255,255,255,0.2)',
      range: [-12, 12],
      scaleanchor: 'x',
      scaleratio: 1,
      showgrid: true,
      tickfont: {
        color: '#aaaaaa'
      },
      title: {
        font: {
          color: '#ffffff'
        },
        text: 'X (Meter) - Vor/Zurück'
      },
      zeroline: true,
      zerolinecolor: 'rgba(255,255,255,0.4)'
    }
  },
  config: {
    displayModeBar: true,
    scrollZoom: true
  }
};
